import React from "react";
import Navbar from "./navbar";
function About(){
    return(
       <div className="container-fluid">
       <Navbar />
       <div className="container"></div>
       <h1>about</h1>
       <div className="icon">
        <ul>
           <a href=""><li className="linkedIn">
            <i class="fa fa-linkedin" aria-hidden="true"></i>
           </li></a> 
        </ul>
       </div>
       </div>
        
    )
}

export default About;
